import React from 'react'

const Coin = () => {
    const url = 'https://api.coingecko.com/api/v3/coins/bitcoin'
    const [coins, setcoins] = useState([])
    useEffect(() => {
      axios.get(url).then((response) => {
        setcoins(response.data)
        console.log(response.data[0])
      }).catch((error) => {
        console.log(error)
      }, [])
    })
  return (
    <div>Coin</div>
  )
}

export default Coin
